--
-- Table structure for table `clientes`
--

DROP TABLE IF EXISTS `clientes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `clientes` (
  `clt_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `clt_cif` char(9) DEFAULT NULL,
  `clt_apelidos` varchar(100) NOT NULL COMMENT 'apelidos ou razon social do cliente',
  `clt_nome` varchar(50) DEFAULT NULL COMMENT 'nome, ou tipo de sociedade (SL, SA, ...) do cliente',
  `clt_enderezo` varchar(100) DEFAULT NULL,
  `clt_cp` char(5) DEFAULT NULL COMMENT 'código postal do cliente',
  `clt_poboacion` varchar(60) DEFAULT NULL,
  `clt_pais` smallint(5) unsigned DEFAULT NULL COMMENT 'código do pais, tendo en conta a táboa de paises',
  `clt_email` varchar(120) DEFAULT NULL,
  `clt_desconto` tinyint(4) DEFAULT '0' COMMENT 'procentaxe de desconto aplicable ao cliente',
  `clt_vendas` smallint(5) unsigned DEFAULT NULL COMMENT 'número de ventas que se lle ficeron ao cliente',
  `clt_ultima_venda` date DEFAULT NULL COMMENT 'data da última venta feita ao cliente',
  `clt_alta` date NOT NULL COMMENT 'data na que se deu de alta ao cliente',
  `clt_ultima_actualizacion` date DEFAULT NULL COMMENT 'data da última actualización feita nos datos do cliente',
  `clt_baixa` date DEFAULT NULL COMMENT 'data na que se deu de baixa ao cliente',
  PRIMARY KEY (`clt_id`),
  UNIQUE KEY `clt_cif` (`clt_cif`),
  KEY `clt_apelidos_nome` (`clt_apelidos`,`clt_nome`),
  KEY `clt_pais` (`clt_pais`),
  CONSTRAINT `fk_clientes_paises` FOREIGN KEY (`clt_pais`) REFERENCES `paises` (`pai_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

