DROP TABLE IF EXISTS `empregados`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `empregados` (
  `emp_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `emp_dni` char(9) DEFAULT NULL,
  `emp_apelidos` varchar(100) NOT NULL DEFAULT '',
  `emp_nome` varchar(50) DEFAULT NULL,
  `emp_enderezo` varchar(100) DEFAULT NULL,
  `emp_cp` char(5) DEFAULT NULL COMMENT 'código postal do empregado',
  `emp_poboacion` varchar(60) DEFAULT NULL,
  `emp_pais` smallint(5) unsigned DEFAULT NULL,
  `emp_alta` date DEFAULT NULL COMMENT 'data na que se deu de alta o empregado',
  PRIMARY KEY (`emp_id`),
  KEY `emp_apelidos_nome` (`emp_apelidos`,`emp_nome`),
  KEY `emp_pais` (`emp_pais`),
  CONSTRAINT `fk_empregados_paises` FOREIGN KEY (`emp_pais`) REFERENCES `paises` (`pai_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=latin1;
